package com.company.vehicleCatalogue_05;public class CatalogueForVehicles {    private String type;    private String model;    private String color;    private Integer horsepower;    public CatalogueForVehicles(String type, String model, String color, Integer horsepower) {        this.type = type;        this.model = model;        this.color = color;        this.horsepower = horsepower;    }    public String getType() {        return type;    }    public String getModel() {        return model;    }    public String getColor() {        return color;    }    public Integer getHorsepower() {        return horsepower;    }}